import axios from 'axios';
import React, { useState, useEffect } from 'react';

function WishList() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5002/getProductsWithImage');
        console.log('Fetched data:', response.data);
        setProducts(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {/* component */}
      <div className="mx-auto container px-4 md:px-6 2xl:px-0 py-12 flex justify-center items-center">
        {/* - more free and premium Tailwind CSS components at https://tailwinduikit.com/ - */}
        <div className="flex flex-col justify-start items-start">
          <div>
            <p className="text-sm leading-4 text-gray-600 dark:text-white">Home</p>
          </div>
          <div className="mt-3">
            <h1 className="text-3xl lg:text-4xl tracking-tight font-semibold leading-8 lg:leading-9 text-gray-800 dark:text-white dark:text-white">
              Favourites
            </h1>
          </div>
          <div className="mt-4">
            <p className="text-2xl tracking-tight leading-6 text-gray-600 dark:text-white">
              {products.length} items
            </p>
          </div>
          <div className="mt-10 lg:mt-12 grid grid-cols-1 lg:grid-cols-3 gap-x-8 gap-y-10 lg:gap-y-0">
            {products.map((product, index) => (
              <div className="flex flex-col" key={index}>
                <div className="relative">
                  <img
                    className="hidden lg:block"
                    src={product.image}
                    alt={product.productName}
                  />
                  <img
                    className="hidden sm:block lg:hidden"
                    src={product.image}
                    alt={product.productName}
                  />
                  <img
                    className="sm:hidden"
                    src={product.image}
                    alt={product.productName}
                  />
                  <button
                    aria-label="close"
                    className="top-4 right-4 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-800 absolute p-1.5 bg-gray-800 dark:bg-white dark:text-gray-800 text-white hover:text-gray-400"
                  >
                    <svg
                      className="fil-current"
                      width={14}
                      height={14}
                      viewBox="0 0 14 14"
                      fill="none"
                      xmlns="http://www.w3.org/2000/svg"
                    >
                      <path
                        d="M13 1L1 13"
                        stroke="currentColor"
                        strokeWidth="1.25"
                        strokeLinecap="round"
                        strokeLinejoin="round"
                      />
                      <path
                        d="M1 1L13 13"
                        stroke="currentColor"
                        strokeWidth="1.25"
                        strokeLinecap="round"
                        strokeLinejoin="round"
                      />
                    </svg>
                  </button>
                </div>
                <div className="mt-6 flex justify-between items-center">
                  <div className="flex justify-center items-center">
                    <p className="tracking-tight text-2xl font-semibold leading-6 text-gray-800 dark:text-white">
                      {product.productName}
                    </p>
                  </div>
                  <div className="flex justify-center items-center">
                    <button
                      aria-label="show menu"
                      onClick={() => handleClick1(true)}
                      className="focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-800 py-2.5 px-2 bg-gray-800 dark:bg-white dark:text-gray-800 text-white hover:text-gray-400 hover:bg-gray-200"
                    >
                      <svg
                        id="chevronUp1"
                        className="fill-stroke"
                        width={10}
                        height={6}
                        viewBox="0 0 10 6"
                        fill="none"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          d="M9 5L5 1L1 5"
                          stroke="currentColor"
                          strokeWidth="1.25"
                          strokeLinecap="round"
                          strokeLinejoin="round"
                        />
                      </svg>
                      <svg
                        id="chevronDown1"
                        className="hidden fill-stroke"
                        width={10}
                        height={6}
                        viewBox="0 0 10 6"
                        fill="none"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          d="M1 1L5 5L9 1"
                          stroke="currentColor"
                          strokeWidth="1.25"
                          strokeLinecap="round"
                          strokeLinejoin="round"
                        />
                      </svg>
                    </button>
                  </div>
                </div>
                <div
                  id={`menu${index}`}
                  className="flex flex-col justify-start items-start mt-12"
                >
                  <div>
                    <p className="tracking-tight text-xs leading-3 text-gray-800 dark:text-white">
                      {product.description}
                    </p>
                  </div>
                  <div className="mt-2">
                    <p className="tracking-tight text-base font-medium leading-4 text-gray-800 dark:text-white">
                      {product.price}
                    </p>
                  </div>
                  {/* ... المزيد من المعلومات ... */}
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default WishList;
